import React from 'react';
import { useNavigate } from 'react-router-dom';
import { BarChart, Bar, LineChart, Line, PieChart, Pie, Cell, Tooltip, Legend, XAxis, YAxis, CartesianGrid } from 'recharts';
import './PowerDashboard.css';

const data = [
  { name: '10:00', voltage: 220, current: 15, powerfactor: 0.95, temperature: 30, frequency: 50 },
  { name: '10:10', voltage: 230, current: 16, powerfactor: 0.97, temperature: 32, frequency: 49.5 },
  { name: '10:20', voltage: 225, current: 14, powerfactor: 0.96, temperature: 29, frequency: 50.2 },
  { name: '10:30', voltage: 235, current: 18, powerfactor: 0.94, temperature: 31, frequency: 50.1 },
];

const PowerDashboard = () => {
  const navigate = useNavigate();

  const handleClick = (graphId, graphType) => {
    const graphData = {
      id: graphId,
      type: graphType,
      data
    };
    navigate(`/details/${graphId}`, { state: { graphData } });
  };

  return (
    <div className="dashboard-container">

      {/* Power (Pie Chart) */}
      <div className="chart-card" onClick={() => handleClick('Power', 'pie')}>
        <PieChart width={300} height={200}>
          <Pie data={data} dataKey="current" nameKey="name" cx="50%" cy="50%" outerRadius={80}>
            {data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={['#8884d8', '#82ca9d', '#ffc658'][index % 3]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </div>

      {/* Voltage (Bar Chart) */}
      <div className="chart-card" onClick={() => handleClick('voltage', 'bar')}>
        <BarChart width={300} height={200} data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="voltage" fill="#8884d8" />
        </BarChart>
      </div>

      {/* Current (Bar Chart) */}
      <div className="chart-card" onClick={() => handleClick('current', 'bar')}>
        <BarChart width={300} height={200} data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="current" fill="#82ca9d" />
        </BarChart>
      </div>

      {/* Power Factor (Line Chart) */}
      <div className="chart-card" onClick={() => handleClick('power-factor', 'line')}>
        <LineChart width={300} height={200} data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="powerfactor" stroke="#8884d8" />
        </LineChart>
      </div>

      {/* Temperature (Line Chart) */}
      <div className="chart-card" onClick={() => handleClick('temperature', 'line')}>
        <LineChart width={300} height={200} data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="temperature" stroke="#ff7300" />
        </LineChart>
      </div>

      {/* Frequency (Line Chart) */}
      <div className="chart-card" onClick={() => handleClick('frequency', 'line')}>
        <LineChart width={300} height={200} data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="frequency" stroke="#82ca9d" />
        </LineChart>
      </div>

    </div>
  );
};

export default PowerDashboard;
